def str_to_date(str_date):
    try:
        datelist = str_date.split('.')
        year = int(datelist[0])
        month = int(datelist[1])
        day = int(datelist[2])
        date_date = datetime.date(year=year, month=month, day=day)
        return date_date
    except Exception:
        print(f"  : {str_date}")

def file_date(date):
    year = str(date.year)
    month = str(date.month)
    day = str(date.day)
    if len(month) == 1:
        month = '0' + month
    if len(day) == 1:
        day = '0' + day
    filedate = f"{year}.{month}.{day}"
    return filedate

