def parse_to_file(instrument, date, recording_mode):
    try:
        print(f"  {instrument}")
        if file_directory == "":
            directory_folder = r"{}\{}.txt".format(os.path.dirname(os.path.abspath(__file__)), instrument)
            file = open(directory_folder, recording_mode)
        else:
            directory_folder = r"{}\{}.txt".format(file_directory, instrument)
            folder_path = os.path.dirname(directory_folder)  #     
            if not os.path.exists(folder_path):  #      
                os.makedirs(folder_path)
            file = open(directory_folder, recording_mode)

        current_date = date
        today_date = final_date

        write_date = current_date - datetime.timedelta(1)
        good_flag = False
        for i in range(40):
            write_instrument_date = f"{write_date.month}/{write_date.day}/{write_date.year}"
            write_date_table = get_table(write_instrument_date, instrument)
            if write_date_table is not None:
                good_flag = True
                break
            write_date = write_date - datetime.timedelta(1)

        if not good_flag:
            raise Exception(f"   {instrument}  ")

        while current_date <= today_date:
            instrument_date = f"{current_date.month}/{current_date.day}/{current_date.year}"

            oi_table = get_table(instrument_date, instrument)
            if oi_table == None:
                print(f" {current_date},     {instrument}.txt (  )\n")
                current_date = current_date + datetime.timedelta(1)
                continue

            table_rows = oi_table.find_all("tr")
            total_oi = table_rows[-1].find_all("td")[9].get_text()
            if total_oi == '0':
                print(f" {current_date},    (oi = 0) {instrument}.txt (  )\n")
                current_date = current_date + datetime.timedelta(1)
                continue

            date_to_write = file_date(write_date)
            file.write(f"{date_to_write}\tFINAL\tTOTAL\t{total_oi}\t")
            write_date = current_date

            for i in range(1, len(table_rows) - 1):
                month_oi = table_rows[i].find_all("td", {"class": "PrevDayStyle"})[-1].get_text()
                if month_oi.isspace():
                    continue
                name_moth = table_rows[i].td.get_text()
                name_moth = name_moth.upper()
                name_moth = name_moth[0] + name_moth[1] + name_moth[2] + ' ' + name_moth[3] + name_moth[4]
                file.write(name_moth + '\t' + month_oi + '\t')


            file.write('\n')
            current_date = current_date + datetime.timedelta(1)

    except Exception as err:
        print(f"-      {instrument}: {err}")
    else:
        print(f" {instrument}.txt  !\n")


def red_end_line(file, number_line_fr_end = 0):
    count_n = -1
    pos = 1
    while count_n != number_line_fr_end:
        str = ""
        ch = ''
        while True:
            pos += 1
            file.seek(-pos, 2)
            ch = file.read(1)
            ch = ch.decode('UTF-8')
            if ch == '\n':
                break
            str = ch + str
        count_n +=1
    return str

def get_seek_endline(file, number_line_fr_end = 0):
    count_n = -1
    pos = 1
    while count_n != number_line_fr_end:
        while True:
            pos += 1
            file.seek(-pos, 2)
            ch = file.read(1)
            ch = ch.decode('UTF-8')
            if ch == '\n':
                break
        count_n += 1
    return pos

def update():
    if file_directory == "":
        directory_folder = r"{}".format(os.path.dirname(os.path.abspath(__file__)))
    else:
        directory_folder = r"{}".format(file_directory)

    files = os.listdir(directory_folder)
    files_list = list(filter(lambda x: x.endswith('.txt'), files))
    instr_list = []
    for file in files_list:
        instr = file.split('.')[0]
        if instr in oi_profiles.keys():
            instr_list.append(instr)

    for instrument in instr_list:
        file_instr = open(f"{instrument}.txt", 'ab+')
        ln = red_end_line(file_instr)
        list_line = ln.split('\t')
        date_str = list_line[0].split('.')
        date = datetime.date(year=int(date_str[0]), month=int(date_str[1]), day=int(date_str[2]))
        i = 0
        while i < 2:
            date += datetime.timedelta(1)
            table = get_table(date, instrument)
            if table == None:
                continue
            else:
                i += 1

        file_instr.close()
        print(date)
        parse_to_file(instrument, date, 'a+')

